function getYourListings(username, listings){
    let ordersTotal = 0, offers = {}, offersValue = 0;
    for(let i = 0; i < listings.length; i++){

        let listing = listings[i];
        if(listing.name === username){
            if(listing.type == "1"){
                //offer, sell

                //the rule of only having one sell listing of each item is saving me work!
                offers[listing.itemId] = {};
                offers[listing.itemId] = {'id': listing.itemId, 'amount': listing.amount}; //'id' is not required since it's the key of the object but I'm just following format
            } else if (listing.type == "2"){
                //order, buy

                ordersTotal += listing.amount * listing.cost;
            }
        }
    }
    offersValue = valueOfItems(offers);

    return {orders: {total: ordersTotal}, offers: {items: offers, value: offersValue}};
}
function valueOfHouseBuilding(v){
    let isAutomationBuilding = !v.enchantLevel; // its automation building if it doesnt have enchant level

    let buildingToLevelCost = countItems(house[isAutomationBuilding ? "automation" : "skillSpeed"], Number(v.level) - 1);
    let enchantingToLevelCost = countItems(enchantingUpgrade, Number(v.enchantLevel) - 1)

    let buildingValue = valueOfItems(buildingToLevelCost);
    let enchantValue = valueOfItems(enchantingToLevelCost);
    return {buildingValue: buildingValue, enchantValue: enchantValue, totalValue: {npc: buildingValue.npc + enchantValue.npc, min: buildingValue.min + enchantValue.min}};

}
function collectionOfSingleItem(itemId, amount){
    return {itemId: {'amount': amount, 'id': itemId}};
}
function countItems(arrayWithItemCollections, maxIndex) {
    let totalCollection = {};
    for (let i = 0; i <= maxIndex; i++) {
        let collection = arrayWithItemCollections[i];
        for (let key in collection) {
            let item = collection[key];
            if (totalCollection[item.id]) {
                totalCollection[item.id].amount += item.amount;
            } else {
                totalCollection[item.id] = {};
                totalCollection[item.id].amount = item.amount;
                totalCollection[item.id].id = item.id;
            }
        }
    }
    return totalCollection;
}

