function minMarket(itemID){
    let itm = item.get(itemID).item;

    if(itm.id == 1) return 1; //item is COIN

    if(itm.attributes.UNTRADEABLE || !itm.attributes.SELL_PRICE) {
        return 0;
    }
    if(specialIds.gem.includes(itm.id)) {
        return itm.attributes.SELL_PRICE * 1.2;
    }
    else if(specialIds.produceItems.includes(itm.id)) {
        return itm.attributes.SELL_PRICE * 1.5 - 1;
    }
    else if(specialIds.food.includes(itm.id)) {
        return Math.round(0.8 * itm.stats.global.HEAL);
    }
    else if(specialIds.smithing.includes(itm.id)) {
        return 2 * Math.round(itm.attributes.SELL_PRICE * 3/4);
    }
    else if(specialIds.legendary.includes(itm.id)) {
        return 25 * itm.attributes.SELL_PRICE;
    }
    else if(specialIds.legendaryEquip.includes(itm.id)) {
        return 50 * itm.attributes.SELL_PRICE;
    }

    return 2 * itm.attributes.SELL_PRICE;
}
