function buildLeaderboardData(username, leaderboardData, userData){
    let data = {}

    data.challenges = entryWhere(leaderboardData.challenges, "name", username);
    data.total = entryWhere(leaderboardData.total, "name", username);
    data.xp = entryWhere(leaderboardData.xp, "name", username);

    data.skills = {};
    for(const k in leaderboardData.skills){
        let v = leaderboardData.skills[k];
        data.skills[k] = entryWhere(v, "name", username);
    }

    for(const k in data) {
        let v = data[k];
        if(!v.rank){
            // no rank means in top 50. add the rank.
            if(k === 'skills'){
                for(const k2 in data.skills) {
                    let v2 = data.skills[k2];
                    if(v2 == null){
                        //you are so far down you aren't on the leaderboard bro
                        data.skills[k2] = {name: username, value: userData.user.skills[k2].exp, rank: -1}
                    }
                    else if(!v2.rank){
                        v2.rank = entryWhere(leaderboardData.skills[k2], 'name', username, true).index + 1; //+1 to convert index to rank
                    }
                }
            }
            else v.rank = entryWhere(leaderboardData[k], 'name', username, true).index + 1; //+1 to convert from index to rank
        }
    }

    return data;
}

