//in object with entries
//[ {a: "Orange", b: 11, c:15}, {A: "Apple", c:6}, {A: "Banana", isBanana: true, b: 12, c: 14} ]
//entryWhere(arr, "A", "Banana") -> returns -> {A: "Banana", isBanana: true, b: 12, c: 14}
function entryWhere(objArr, propertyName, propertyValue, returnIndex = false){
    const index = objArr.findIndex(obj => obj[propertyName] == propertyValue);

    if (returnIndex) {
        return index !== -1 ? { index: index, entry: objArr[index] } : null;
    } else {
        return index !== -1 ? objArr[index] : null;
    }
}


