const isValidJSON = str => {
    try {
        JSON.parse(str);
        return true;
    } catch (e) {
        return false;
    }
};
function commas(num, roundWhole = false) {
    if(num == undefined) return NaN;
    const roundedNum = roundWhole ? Math.round(num) : Math.round(num * 100) / 100;
    return roundedNum.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}
function lv(xp) {
    if(xp <= 12000000) return Math.floor(Math.pow((xp + 1)/1.2, 2/7)); //less than 100 formula
    else return 100 + Math.floor(Math.log((xp + 1)/12000000) / Math.log(Math.pow(3500, 0.01))); //lv100+ formula
}
